import React from 'react'

function Navbar() {
    return (
        
        <div className='navbar'>
        <img src="./img/addAvatar.png" alt="user image" />
            <span className="logo">Lucky's Chat</span>
            <div className="user">
                
                <span>Mahaveer</span>
                <button>logout</button>
            </div>
        </div>
    );
  }
  
  export default Navbar;
